import React from 'react';
import { withRouter, NavLink } from 'react-router-dom';
import './btn-page-nav.scss';

const BtnPageNav = (props) => {
    return (
        <NavLink className={'btn-page-nav btn-page-nav-' + props.color  + (props.current?' btn-page-nav-current':"")} >{props.text}</NavLink>
    );
}

export default BtnPageNav;
